import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [user, setUser] = useState(null);
  const [error, setError] = useState(null);
  const [emails, setEmails] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [isFetchingEmails, setIsFetchingEmails] = useState(false);

    useEffect(() => {
    const fetchUser = async () => {
      try {
        const response = await fetch('http://localhost:8080/user', { credentials: 'include' });
        if (response.ok) {
          const data = await response.json();
          setUser(data);
        } else {
          setUser(null);
        }
      } catch (err) {
        setError('Could not connect to the backend. Is it running?');
        setUser(null);
      } finally {
        setIsLoading(false);
      }
    };
    fetchUser();
  }, []);

  const login = () => {
    window.location.href = 'http://localhost:8080/oauth2/authorization/google';
  };

  const logout = async () => {
    await fetch('http://localhost:8080/logout', { method: 'POST', credentials: 'include' });
    setUser(null);
    setEmails([]);
  };

    const getEmails = async () => {
    setIsFetchingEmails(true);
    setError(null);
    try {
      const response = await fetch('http://localhost:8080/api/emails', { credentials: 'include' });
      if (response.ok) {
        const data = await response.json();
        setEmails(data);
      } else {
        setError('Failed to fetch emails. Please try again.');
      }
    } catch (err) {
      setError('An error occurred while fetching emails.');
    } finally {
      setIsFetchingEmails(false);
    }
  };

    const handleEmailClick = async (email) => {
    // This will be refactored in the next step to show attachments before downloading
    alert(`Fetching attachments for email ID: ${email.id}`);
    try {
      const response = await fetch(`http://localhost:8080/api/attachments/${email.id}`, { credentials: 'include' });
      if (response.ok) {
        const attachments = await response.json();
        if (attachments.length === 0) {
          alert('This email has no attachments.');
          return;
        }
        attachments.forEach(downloadAttachment);
      } else {
        setError('Could not fetch attachments.');
      }
    } catch (err) {
      setError('An error occurred while fetching attachments.');
    }
  };

  const downloadAttachment = ({ filename, mimeType, data }) => {
    const byteCharacters = atob(data.replace(/-/g, '+').replace(/_/g, '/'));
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    const blob = new Blob([byteArray], { type: mimeType });

    const link = document.createElement('a');
    link.href = window.URL.createObjectURL(blob);
    link.download = filename;
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

    if (isLoading) {
    return <div className="App"><header className="App-header"><p>Loading...</p></header></div>;
  }

  return (
    <div className="App">
      <header className="App-header">
        <h1>Gmail Plugin</h1>
        {user && user.name !== 'Guest' ? (
          <div>
            <p>Welcome, {user.name}!</p>
            <button onClick={logout}>Logout</button>
            <hr />
            <button onClick={getEmails} disabled={isFetchingEmails}>
              {isFetchingEmails ? 'Fetching...' : 'Get Recent Emails with Attachments'}
            </button>

            {error && <p className="error-message">{error}</p>}

            <ul className="email-list">
              {emails.map((email) => (
                <li key={email.id} onClick={() => handleEmailClick(email)}>
                  {email.subject}
                </li>
              ))}
            </ul>
          </div>
        ) : (
          <div>
            <button onClick={login}>Login with Google</button>
            {error && <p className="error-message">{error}</p>}
          </div>
        )}
      </header>
    </div>
  );
}

export default App;
